using Algorithms.Recursion;
using System;
using System.Collections.Generic;
using System.Numerics;
using System.Text;
using Xunit;

namespace Algorithms.Test
{
    public class RecursionTest
    {
        private const string factorialOf100 = "93326215443944152681699238856266700490715968264381621468592963895217599993229915608941463976156518286253697920827223758251185210916864000000000000000000000000";
        private const string factorialOf1000 = "";
        private const string factorialOf4000 = "";
        private const string factorialOf4794 = "";
        private const string factorialOf10000 = "";

        private const string fibonacci4000 = "";

        [Fact]
        public void FactorialWorks()
        {
            Assert.Equal((BigInteger)120, Classics.Factorial(5));

            Assert.Equal(BigInteger.Parse(factorialOf100), Classics.Factorial(100));

            Assert.Equal(BigInteger.Parse(factorialOf1000), Classics.Factorial(1000));

            Assert.Equal(BigInteger.Parse(factorialOf4000), Classics.Factorial(4000));

            Assert.Equal(BigInteger.Parse(factorialOf4794), Classics.Factorial(4794));

            // This causes stack overflow...
            //Assert.Equal(BigInteger.Parse(factorialOf10000), Classics.Factorial(10000));
        }

        [Fact]
        public void FibonacciWorks()
        {
            Assert.Equal(4181, Classics.Fibonacci(20));
            Assert.Equal(BigInteger.Parse(fibonacci4000), Classics.Fibonacci(4000));
        }
    }
}